import { useNavigate } from "react-router-dom";

const Navigate =() => {
    const navigate = useNavigate();
    const goOpen = () => {
        navigate(`/open`);
    }
    const goCommunity = () => {
        navigate(`/community`);
    }

    const goMypage = () => {
        navigate(`/mypage`);
    }
};

export default Navigate;
